<div class="Section6"><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
sudo apt update
sudo apt upgrade
#================================================
