<h1 class="Section4">
<a class="Section5" href="#" id="configuration-de-l-utilisateur-sudo">Configuration de l'utilisateur sudo</a>
</h1>
<div class="Section6"><br>Problème:<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
sudo apt update
#================================================
adminvm is not in the sudoers file.  This incident will be reported.
#================================================</pre><br>Solution:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
su
#================================================
nano /etc/sudoers
#================================================
adminvm ALL=(ALL) ALL
#================================================</pre><br></div>
</div>
</div>
</div><br>